import React from 'react';
import './FuryBrand.css';

const FuryBrand = () => {
  return (
    <div className="fury-brand">
      <div className="fury-container">
        <div className="fury-content">
          <h1 className="fury-title">Fury</h1>
          <p className="fury-description">
            Sự mới lạ của Fury từ năm 2009. Fury nhanh chóng đạt được thành công trên thị trường 
            thương mại Âu và Mỹ. Thương hiệu này được biết đến với chất lượng cao của sản 
            phẩm thể thao billiards. Fury hiện tại đang được bán tại nhiều nước trên thế giới 
            và là một trong những thương hiệu hàng đầu về cơ bida. Sự đa dạng sản phẩm của 
            Fury được thể hiện qua nhiều mẫu mã khác nhau phù hợp với nhu cầu của nhiều khách 
            hàng từ người mới bắt đầu đến những người chơi chuyên nghiệp.
          </p>
        </div>
      </div>
    </div>
  );
};

export default FuryBrand;
